import React from "react";
import "./style.css";
import articleData from "./articledata";
import winexplorertarget from "./png/winexplorertarget.png";
import fileexplorerthispc from "./png/fileexplorerthispc.png";
import smb1error from "./png/smb1error.png";
import Navbar from "./Navbar";
import Headline from "./Headline";
import Article from "./Article";

class App extends React.Component {
  render() {

    const images = [winexplorertarget, fileexplorerthispc, smb1error];

    return (
      <div>
        <Navbar />
        <div id="nav-filler"></div>
        <Headline />
        {articleData.map(item => (
          <Article
            category={item.category}
            title={item.title}
            subtitle={item.subtitle}
            description={item.description}
            instructions={item.instructions.map(item => (
              <li>{item}</li>
            ))}
            img={images[item.id]}
            alt={item.alt}
          />
          ))};
      </div>
    );
  }
}

export default App;
